export class Template {
  constructor(
    public id?: number,
    public templateId?: number,
    public templateName?: string,
    public templateDescription?: string,
    public templateStatus?: string,
    public templateEffectiveDt?: any,
    public templateExpiryDt?: any,
    public templateCategory?: string,
    public templateLastVersion?: number,
    public templateLastFileName?: string,
    public createdBy?: string,
    public createdDt?: any,
    public updatedBy?: string,
    public updatedDt?: any,
    public generateForm?: string
  ) {}
}
